import {useEffect } from 'react'
const Zone = (zone) => {
    useEffect(() => {
        document.getElementById("mylabel").innerHTML = zone.zone.name
    }, [])
    
    return (
     <li>
         <label id="mylabel"/>
         <input name = {zone.name} type = "checkbox" value={zone.name}/>
     </li>
    )
    
   

}

export default Zone
